import React from "react";
import "./products.css";

const Product = props => {
  const { productInfo, onClickHandler } = props,
    { id, name, image, price, description } = productInfo;

  return (
    <div onClick={onClickHandler} className="product-card">
      <span>Name: {name}</span>
      {/* <img src={`/assessts/images/${image}`} /> */}
      <span>Price: {price}</span>
      <div>{description}</div>
    </div>
  );
};

export default Product;
